import { BrowserRouter, Routes, Route } from "react-router-dom";

// Authentication Components
import Login from './Resident/Login';
import Newuser from "./Resident/Newuser";
import Forgot from "./Resident/Forgot";

// User Components
import UserDashboard from "./Resident/UserDashboard";
import ViewRequest from "./Resident/ViewRequest";
import RaiseRequest from "./Resident/RaiseRequest";
import RequestDetail from "./Resident/RequestDetail";
import MyRequests from "./Resident/MyRequests";

// Admin Components
import AdminDashboard from "./Resident/AdminDashboard";
import ManageUsers from "./Resident/ManageUsers";
import ManageServices from "./Resident/ManageServices";
import ManageRequests from "./Resident/ManageRequests";

// Super Admin Components
import SuperAdminDashboard from "./Resident/SuperAdminDashboard";
import SuperAdminReports from "./Resident/SuperAdminReports";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        {/* Authentication Routes */}
        <Route path="/" element={<Login />} />
        <Route path="/login" element={<Login />} />
        <Route path="/newuser" element={<Newuser />} />
        <Route path="/forgot" element={<Forgot />} />

        {/* User Routes */}
        <Route path="/userdashboard" element={<UserDashboard />} />
        <Route path="/raiserequest" element={<RaiseRequest />} />
        <Route path="/viewrequest" element={<ViewRequest />} />
        <Route path="/requestdetail/:id" element={<RequestDetail />} />
        <Route path="/myrequest" element={<MyRequests />} />

        {/* Admin Routes */}
        <Route path="/admindashboard" element={<AdminDashboard />} />
        <Route path="/manageusers" element={<ManageUsers />} />
        <Route path="/manageservices" element={<ManageServices />} />
        <Route path="/managerequests" element={<ManageRequest />} />

        {/* Super Admin Routes */}
        <Route path="/superadmindashboard" element={<SuperAdminDashboard />} />
        <Route path="/reports" element={<SuperAdminReports />} />

        {/* Fallback Route */}
        <Route path="*" element={<Login />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
